// export default App;
import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">

      {/* HEADER / NAVBAR */}
      <header className="header">
        <div className="logo-and-nav">
          {/* Logo area (you can replace text with an actual logo image) */}
          <div className="logo">
            <img 
              src="https://via.placeholder.com/60" 
              alt="EMCON Logo" 
              className="logo-img"
            />
            <h1>EMCON</h1>
          </div>

          {/* Navigation Links */}
          <nav className="nav-links">
            <a href="#home">Home</a>
            <a href="#find-hospitals">Find Hospitals</a>
            <a href="#insurance">Insurance</a>
            <a href="#donations">Donations</a>
            <a href="#medical-card">Medical Card</a>
          </nav>
        </div>
      </header>

      {/* MAIN CONTENT */}
      <main className="main-content">
        {/* Arrow to go back (you can replace with an actual icon if you want) */}
        <div className="back-arrow">
          <span className="arrow">&larr;</span>
        </div>
        <img src="/Users/salmanajmal/Desktop/SE/hospital/src/kk.png" alt="EMCON Logo" className="logo-img" />
        {/* Sign-In Form */}
        <div className="signin-container">
          <h2>Sign In as a User</h2>
          <form className="signin-form">
            <label htmlFor="username">Username</label>
            <input 
              type="text" 
              id="username" 
              name="username" 
              placeholder="Enter your username"
            />

            <label htmlFor="password">Password</label>
            <input 
              type="password" 
              id="password" 
              name="password" 
              placeholder="Enter your password"
            />

            <div className="admin-link">
              <a href="#hospital-admin">Sign in as Hospital Admin instead?</a>
            </div>

            <button type="submit" className="submit-btn">Submit</button>
          </form>
        </div>
      </main>

      {/* FOOTER */}
      <footer className="footer">
        <div className="footer-top">
          <h1>EMCON</h1>
          <p>Smart healthcare navigation for everyone!</p>
        </div>

        <div className="footer-bottom">
          {/* Social or other links can go here */}
          <nav className="footer-links">
            <a href="#home">Home</a>
            <a href="#find-hospitals">Find Hospitals</a>
            <a href="#insurance">Insurance</a>
            <a href="#donations">Donations</a>
            <a href="#medical-card">Medical Card</a>
          </nav>
        </div>
      </footer>
    </div>
  );
}

export default App;
